import "./ProductsLayout.css";
function ProductsLayout() {
  return (
    <section className="ProductsLayout">
      <h1 className="ProductsLayout-name">
        Name:<p className="ProductsLayout-name-item">Item#1</p>
      </h1>
      <h1 className="ProductsLayout-price">
        Price:<p className="ProductsLayout-price-itemPrice">100$</p>
      </h1>
      <p className="ProductsLayout-details">Details Here !!</p>
      <div className="ProductLayout-div">
        <label className="ProductsLayout-quantity">
          Quantity
          <input className="ProductsLayout-quantity-inp"></input>
        </label>
      </div>
    </section>
  );
}
export default ProductsLayout;
